// import { Fragment } from 'react';
// import Counter from './components/Counter';
// import Header from './components/Header';
// import Auth from './components/Auth'
import { LandingPage } from './landing/LandingPage';
import { CalendarPage, loader as calendarLoader } from './calendar/CalendarPage';
import { createBrowserRouter, RouterProvider } from 'react-router-dom';
import RootLayout from './components/RootLayout';
import ErrorPage from './components/ErrorPage';
import CalendarDetails from './calendar/CalendarDetails';

const router = createBrowserRouter([
  {
    path:'/', 
    element: <RootLayout />,
    errorElement: <ErrorPage />,
    children: [
      {index: true, element: <LandingPage />},
      {path: '/calendar', 
      children: [
        {index: true, element: <CalendarPage />, loader: calendarLoader},
        {path: ':calendarId', element: <CalendarDetails />},
      ]
      },
    ]
  },
]);

function App() {
  return <RouterProvider router={router}/>;
}

export default App;
